const Showcase: React.FC = () => {
    return (
        <div className="container">
        <Header />
        <div className="content">  <DateDisplay />
            <h2 style={{ fontSize: '3em', padding: '0px', textAlign: 'center', fontFamily: ' '}}>Education</h2>
        </div>
            <h1></h1>
            <Footer />
        </div>
    );
};

export default Showcase;
